function App() {
  const [myName, setMyName] = useState(myInput);

  return (
    <>
    <Routes>

        <Route path="/" element={<HomePage  myName={myName} setMyName={setMyName}  />} />
        <Route path="/signup" element={<Signup myName={myName} setMyName={setMyName} />} />

      </Routes>
    </>
  );
}
export default App;
